import React from 'react'
import { Form, Button } from "react-bootstrap";
import './consultationrequest.css'

const [type, setType] = useState("");
const [message, setMessage] = useState("");
const [firstName, setFirstName] = useState("");
const [surname, setSurname] = useState("");
const [phone, setPhone] = useState("");
const [email, setEmail] = useState("");
const [checked, setChecked] = useState(false);

function ConsultationRequest() {
  return (
    <div className="container border text-center">
      <div className="form-holder border m-auto">
        <h5>Request a free consultation</h5>
         <Form onSubmit={handleSubmit}>
      <Form.Group>
        <Form.Label>What type of consultation would you like?</Form.Label>
        <div>
          <Form.Check
            type="radio"
            id="phone"
            label="Phone call"
            name="type"
            checked={type === "phone"}
            onChange={() => setType("phone")}
          />
          <Form.Check
            type="radio"
            id="face-to-face"
            label="Face to face"
            name="type"
            checked={type === "face-to-face"}
            onChange={() => setType("face-to-face")}
          />
        </div>
      </Form.Group>

      <Form.Group>
        <Form.Label>What would you like to discuss?</Form.Label>
        <Form.Control
          type="text"
          placeholder="Please enter your message here"
          value={message}
          onChange={(event) => setMessage(event.target.value)}
        />
      </Form.Group>

      <Form.Group>
        <Form.Label>First name</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter your first name"
          value={firstName}
          onChange={(event) => setFirstName(event.target.value)}
        />
      </Form.Group>

      <Form.Group>
        <Form.Label>Surname</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter your surname"
          value={surname}
          onChange={(event) => setSurname(event.target.value)}
        />
      </Form.Group>

      <Form.Group>
        <Form.Label>Phone number</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter your phone number"
          value={phone}
          onChange={(event) => setPhone(event.target.value)}
        />
      </Form.Group>

      <Form.Group>
        <Form.Label>Email address</Form.Label>
        <Form.Control
          type="email"
          placeholder="Enter your email address"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
        />
      </Form.Group>

      <Form.Group>
        <Form.Check
          type="checkbox"
          label="I am not a robot"
          checked={checked}
          onChange={() => setChecked(!checked)}
        />
      </Form.Group>

      <Button variant="primary" type="submit" disabled={!checked}>
        Submit
      </Button>
    </Form>
      </div>
    </div>
  );
}

export default ConsultationRequest

